import React from 'react'

function Header() {
  return (
    <header class="header">
      <nav class="head-list">
        <a class="button" href="#habilidades">Home</a>
        <a class="button" href="#outrasHabilidades">Sobre Mim</a>
        <a class="button" href="#links">Projetos</a>
      </nav>
    </header>
  )
}

export default Header
